import React, { Component } from 'react'

import "./Programs.css"

class ProgramsList extends Component {

    async render(){
        try {
            const res = await fetch('/programs?token=' + localStorage.token)
            console.log(res)
            return res.data
        }
        catch (err) {
            console.log(err)
        }


    }
}

export default ProgramsList
